TITLE:
  - 'Test case for scatra-thermo interaction involving electrochemistry and electrode-electrolyte interface
    coupling:'
  - '- based on results in Taralov et al., Berichte des Fraunhofer ITWM, Nr. 221 (2012)'
  - '- three-dimensional problem with two two-dimensional electrode-electrolyte interfaces'
  - '- four box-shaped anode particles, electrolyte, and four box-shaped cathode particles,'
  - 'each with constant initial lithium concentrations, electric potentials, and temperatures'
  - '- charge transfer kinetics characterized by Butler-Volmer-Peltier kinetics'
  - '- discharge from partially charged state at C rate of approximately 0.8'
  - '- 818 tet4 and hex8 elements with non-matching interface nodes'
  - '- cf. bachelor thesis by Mykyta Denysov (2017) for details'
